### Problem

When PwmOut::write() is called with 0 and 0.5 parameter by toggling, output signal level wrongly tied to high level often by write(0).
Original report is [here](https://developer.mbed.org/users/nameless129/code/PwmOut_LPC812/).
### Test code

```
#include "mbed.h"

PwmOut pwm1(D2); // P0_6

int main()
{
    pwm1.period_us(26);
    pwm1.write(0);

    while(1) {
        pwm1.write(0.5); // 50% duty
        wait(1);
        pwm1.write(0);   // should be low level
        wait(1);
    }
}
```
